                        v_jy += (aj2 * (gx[2048] - yjyi * Iy) - 1 * gx[1920]) * prod_xz;
                        v_ly += (al2 * (gx[2208] - ylyk * Iy) - 1 * gx[1440]) * prod_xz;
                        v_jz += aj2 * (gx[2336] - zjzi * Iz) * prod_xy;
