        if (jk.n_dm == 1) {
            if (jk.k_factor != 0) {
                double fac = fac_sym * jk.k_factor;
                dd_cache0 += fac * (dm[(j0+0)*nao+(k0+0)] * dm[(i0+0)*nao+(l0+0)] + dm[(j0+0)*nao+(l0+0)] * dm[(i0+0)*nao+(k0+0)]);
