                    v_iy += fyi * prod_xz;
                    double trr_32z = cpz * trr_31z + 1*b01 * trr_30z + 3*b00 * trr_21z;
                    fzi = ai2 * trr_32z;
                    fzi -= 2 * trr_12z;
                    v_iz += fzi * prod_xy;
                    fxj = aj2 * hrr_0100x;
                    v_jx += fxj * prod_yz;
                    fyj = aj2 * hrr_0100y;
                    v_jy += fyj * prod_xz;
                    double hrr_2120z = trr_32z - zjzi * trr_22z;
                    fzj = aj2 * hrr_2120z;
                    v_jz += fzj * prod_xy;
                    fxk = ak2 * trr_01x;
                    v_kx += fxk * prod_yz;
                    fyk = ak2 * trr_01y;
                    v_ky += fyk * prod_xz;
                    double trr_23z = cpz * trr_22z + 2*b01 * trr_21z + 2*b00 * trr_12z;
                    fzk = ak2 * trr_23z;
                    fzk -= 2 * trr_21z;
                    v_kz += fzk * prod_xy;
                    fxl = al2 * hrr_0001x;
                    v_lx += fxl * prod_yz;
                    fyl = al2 * hrr_0001y;
                    v_ly += fyl * prod_xz;
                    double hrr_2021z = trr_23z - zlzk * trr_22z;
                    fzl = al2 * hrr_2021z;
                    v_lz += fzl * prod_xy;
                }
            }
        }
        if (task_id >= ntasks) {
            break;
        }
        int ka = bas[ksh*BAS_SLOTS+ATOM_OF];
        int la = bas[lsh*BAS_SLOTS+ATOM_OF];
        double *ejk = jk.ejk;
        atomicAdd(ejk+ka*3+0, v_kx);
        atomicAdd(ejk+ka*3+1, v_ky);
        atomicAdd(ejk+ka*3+2, v_kz);
        atomicAdd(ejk+la*3+0, v_lx);
        atomicAdd(ejk+la*3+1, v_ly);
        atomicAdd(ejk+la*3+2, v_lz);
    }
    int ia = bas[ish*BAS_SLOTS+ATOM_OF];
    int ja = bas[jsh*BAS_SLOTS+ATOM_OF];
    double *ejk = jk.ejk;
    atomicAdd(ejk+ia*3+0, v_ix);
    atomicAdd(ejk+ia*3+1, v_iy);
    atomicAdd(ejk+ia*3+2, v_iz);
    atomicAdd(ejk+ja*3+0, v_jx);
    atomicAdd(ejk+ja*3+1, v_jy);
    atomicAdd(ejk+ja*3+2, v_jz);
}
}

__global__ static
void rys_ejk_ip1_2021(RysIntEnvVars envs, JKEnergy jk, BoundsInfo bounds,
                     int *pool, double *dd_pool, int *head)
{
    int sq_id = threadIdx.x;
    int gout_id = threadIdx.y;
    constexpr int nsq_per_block = 32;
    constexpr int gout_stride = 8;
    int thread_id = threadIdx.y * nsq_per_block + threadIdx.x;
    int threads = nsq_per_block * gout_stride;
    int *bas_kl_idx = pool + blockIdx.x * QUEUE_DEPTH;
    double *dd_cache = dd_pool + blockIdx.x * 3456 + sq_id;
    __shared__ int ntasks, pair_ij;
while (1) {
    if (thread_id == 0) {
        pair_ij = atomicAdd(head, 1);
    }
    __syncthreads();
    if (pair_ij >= bounds.npairs_ij) {
        return;
    }
    int bas_ij = bounds.pair_ij_mapping[pair_ij];
    if (thread_id == 0) {
        ntasks = 0;
    }
    __syncthreads();
    if (jk.lr_factor != 0) {
        _fill_ejk_tasks(&ntasks, bas_kl_idx, bas_ij, jk, envs, bounds);
    } else {
        _fill_sr_ejk_tasks(&ntasks, bas_kl_idx, bas_ij, jk, envs, bounds);
    }
    if (ntasks == 0) {
        continue;
    }

    int nbas = envs.nbas;
    int *bas = envs.bas;
    double *env = envs.env;
    int iprim = bounds.iprim;
    int jprim = bounds.jprim;
    int kprim = bounds.kprim;
    int lprim = bounds.lprim;
    int nroots = bounds.nroots;
    extern __shared__ double shared_memory[];
    double *rlrk = shared_memory + sq_id;
    double *Rpq = shared_memory + nsq_per_block * 3 + sq_id;
    double *gx = shared_memory + nsq_per_block * 6 + sq_id;
    double *rw = shared_memory + nsq_per_block * 102 + sq_id;
    double *cicj_cache = shared_memory + nsq_per_block * (102+nroots*2);

    __shared__ int ish;
    __shared__ int jsh;
    __shared__ double ri[3];
    __shared__ double rjri[3];
    if (thread_id == 0) {
        ish = bas_ij / nbas;
        jsh = bas_ij % nbas;
    }
    __syncthreads();
    double *expi = env + bas[ish*BAS_SLOTS+PTR_EXP];
    double *expj = env + bas[jsh*BAS_SLOTS+PTR_EXP];
    double *ci = env + bas[ish*BAS_SLOTS+PTR_COEFF];
    double *cj = env + bas[jsh*BAS_SLOTS+PTR_COEFF];
    if (thread_id < 3) {
        int ri_ptr = bas[ish*BAS_SLOTS+PTR_BAS_COORD];
        int rj_ptr = bas[jsh*BAS_SLOTS+PTR_BAS_COORD];
        ri[thread_id] = env[ri_ptr+thread_id];
        rjri[thread_id] = env[rj_ptr+thread_id] - ri[thread_id];
    }
    __syncthreads();
    double xjxi = rjri[0];
    double yjyi = rjri[1];
    double zjzi = rjri[2];
    for (int ij = thread_id; ij < iprim*jprim; ij += threads) {
        int ip = ij / jprim;
        int jp = ij % jprim;
        double ai = expi[ip];
        double aj = expj[jp];
        double aij = ai + aj;
        double theta_ij = ai * aj / aij;
        double rr_ij = xjxi*xjxi + yjyi*yjyi + zjzi*zjzi;
        double Kab = exp(-theta_ij * rr_ij);
        cicj_cache[ij] = ci[ip] * cj[jp] * Kab;
    }

    int *ao_loc = envs.ao_loc;
    int nao = ao_loc[nbas];
    double *dm = jk.dm;
    double v_ix = 0;
    double v_iy = 0;
    double v_iz = 0;
    double v_jx = 0;
    double v_jy = 0;
    double v_jz = 0;

    for (int task_id = sq_id; task_id < ntasks+sq_id; task_id += nsq_per_block) {
        __syncthreads();
        int bas_kl = bas_kl_idx[task_id];
        int ksh = bas_kl / nbas;
        int lsh = bas_kl % nbas;
        double fac_sym = PI_FAC;
        if (task_id < ntasks) {
            if (ish == jsh) fac_sym *= .5;
            if (ksh == lsh) fac_sym *= .5;
            if (ish*nbas+jsh == bas_kl) fac_sym *= .5;
        } else {
            fac_sym = 0;
        }
        int i0 = ao_loc[ish];
        int j0 = ao_loc[jsh];
        int k0 = ao_loc[ksh];
        int l0 = ao_loc[lsh];
        double *expi = env + bas[ish*BAS_SLOTS+PTR_EXP];
        double *expj = env + bas[jsh*BAS_SLOTS+PTR_EXP];
        double *expk = env + bas[ksh*BAS_SLOTS+PTR_EXP];
        double *expl = env + bas[lsh*BAS_SLOTS+PTR_EXP];
        double *ck = env + bas[ksh*BAS_SLOTS+PTR_COEFF];
        double *cl = env + bas[lsh*BAS_SLOTS+PTR_COEFF];
        double *rk = env + bas[ksh*BAS_SLOTS+PTR_BAS_COORD];
        double *rl = env + bas[lsh*BAS_SLOTS+PTR_BAS_COORD];
        double xlxk = rl[0] - rk[0];
        double ylyk = rl[1] - rk[1];
        double zlzk = rl[2] - rk[2];
        if (gout_id == 0) {
            rlrk[0] = xlxk;
            rlrk[32] = ylyk;
            rlrk[64] = zlzk;
        }
        double v_kx = 0;
        double v_ky = 0;
        double v_kz = 0;
        double v_lx = 0;
        double v_ly = 0;
        double v_lz = 0;
        double dd;
        double prod_xy;
        double prod_xz;
        double prod_yz;
        double Ix, Iy, Iz;
        int do_j = jk.j_factor != 0.;
        int do_k = jk.k_factor != 0.;
        if (jk.n_dm == 1) {
            for (int n = gout_id; n < 108; n+=8) {
                int kl = n / 6;
                int ij = n % 6;
                int i = ij % 6;
                int j = ij / 6;
                int k = kl % 6;
                int l = kl / 6;
                int _i = i + i0;
                int _j = j + j0;
                int _k = k + k0;
                int _l = l + l0;
                int _jl = _j*nao+_l;
                int _jk = _j*nao+_k;
                int _il = _i*nao+_l;
                int _ik = _i*nao+_k;
                int _ji = _j*nao+_i;
                int _lk = _l*nao+_k;
                double dd = 0;
                if (do_k) {
                    dd += jk.k_factor * (dm[_jk] * dm[_il] + dm[_jl] * dm[_ik]);
                }
                if (do_j) {
                    dd += jk.j_factor * dm[_ji] * dm[_lk];
                }
                dd_cache[n*32] = fac_sym * dd;
            }
        } else {
            double *dmb = dm + nao * nao;
            for (int n = gout_id; n < 108; n+=8) {
                int kl = n / 6;
                int ij = n % 6;
                int i = ij % 6;
                int j = ij / 6;
                int k = kl % 6;
                int l = kl / 6;
                int _i = i + i0;
                int _j = j + j0;
                int _k = k + k0;
                int _l = l + l0;
                int _jl = _j*nao+_l;
                int _jk = _j*nao+_k;
                int _il = _i*nao+_l;
                int _ik = _i*nao+_k;
                int _ji = _j*nao+_i;
                int _lk = _l*nao+_k;
                double dd = 0;
                if (do_k) {
                    dd += jk.k_factor * (dm [_jk] * dm [_il] + dm [_jl] * dm [_ik] +
                                         dmb[_jk] * dmb[_il] + dmb[_jl] * dmb[_ik]);
                }
                if (do_j) {
                    dd += jk.j_factor * (dm[_ji] + dmb[_ji]) * (dm[_lk] + dmb[_lk]);
                }
                dd_cache[n*32] = fac_sym * dd;
            }
        }

        for (int klp = 0; klp < kprim*lprim; ++klp) {
            int kp = klp / lprim;
            int lp = klp % lprim;
            double ak = expk[kp];
            double al = expl[lp];
            double ak2 = ak * 2;
            double al2 = al * 2;
            double akl = ak + al;
            double al_akl = al / akl;
            double theta_kl = ak * al_akl;
            __syncthreads();
            if (gout_id == 0) {
                double xlxk = rlrk[0];
                double ylyk = rlrk[32];
                double zlzk = rlrk[64];
                double Kcd = exp(-theta_kl * (xlxk*xlxk+ylyk*ylyk+zlzk*zlzk));
                double ckcl = ck[kp] * cl[lp] * Kcd;
                gx[0] = ckcl;
            }
            for (int ijp = 0; ijp < iprim*jprim; ++ijp) {
                int ip = ijp / jprim;
                int jp = ijp % jprim;
                double ai = expi[ip];
                double aj = expj[jp];
                double ai2 = ai * 2;
                double aj2 = aj * 2;
                double aij = ai + aj;
                double aj_aij = aj / aij;
                double xij = ri[0] + (rjri[0]) * aj_aij;
                double yij = ri[1] + (rjri[1]) * aj_aij;
                double zij = ri[2] + (rjri[2]) * aj_aij;
                double xkl = rk[0] + rlrk[0] * al_akl;
                double ykl = rk[1] + rlrk[32] * al_akl;
                double zkl = rk[2] + rlrk[64] * al_akl;
                double xpq = xij - xkl;
                double ypq = yij - ykl;
                double zpq = zij - zkl;
                double theta = aij * akl / (aij + akl);
                double rr = xpq * xpq + ypq * ypq + zpq * zpq;
                __syncthreads();
                if (gout_id == 0) {
                    Rpq[0] = xpq;
                    Rpq[32] = ypq;
                    Rpq[64] = zpq;
                    double cicj = cicj_cache[ijp];
                    gx[1024] = cicj / (aij*akl*sqrt(aij+akl));
                }
                int nroots = bounds.nroots;
                rys_roots_for_k(nroots, theta, rr, rw, jk.omega, jk.lr_factor, jk.sr_factor);
                double s0, s1, s2;
                for (int irys = 0; irys < nroots; ++irys) {
                    __syncthreads();
                    double rt = rw[irys*64];
                    double rt_aa = rt / (aij + akl);
                    double rt_aij = rt_aa * akl;
                    double rt_akl = rt_aa * aij;
                    double b00 = .5 * rt_aa;
                    double b10 = .5/aij * (1 - rt_aij);
                    double b01 = .5/akl * (1 - rt_akl);
                    for (int n = gout_id; n < 3; n += 8) {
                        if (n == 2) {
                            gx[2048] = rw[irys*64+32];
                        }
                        double *_gx = gx + n * 1024;
                        double xjxi = rjri[n];
                        double Rpa = xjxi * aj_aij;
                        double c0x = Rpa - rt_aij * Rpq[n*32];
                        s0 = _gx[0];
                        s1 = c0x * s0;
                        _gx[32] = s1;
                        s2 = c0x * s1 + 1 * b10 * s0;
                        _gx[64] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = c0x * s1 + 2 * b10 * s0;
                        _gx[96] = s2;
                        double xlxk = rlrk[n*32];
                        double Rqc = xlxk * al_akl;
                        double cpx = Rqc + rt_akl * Rpq[n*32];
                        s0 = _gx[0];
                        s1 = cpx * s0;
                        _gx[128] = s1;
                        s2 = cpx*s1 + 1 * b01 *s0;
                        _gx[256] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 2 * b01 *s0;
                        _gx[384] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 3 * b01 *s0;
                        _gx[512] = s2;
                        s0 = _gx[32];
                        s1 = cpx * s0;
                        s1 += 1 * b00 * _gx[0];
                        _gx[160] = s1;
                        s2 = cpx*s1 + 1 * b01 *s0;
                        s2 += 1 * b00 * _gx[128];
                        _gx[288] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 2 * b01 *s0;
                        s2 += 1 * b00 * _gx[256];
                        _gx[416] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 3 * b01 *s0;
                        s2 += 1 * b00 * _gx[384];
                        _gx[544] = s2;
                        s0 = _gx[64];
                        s1 = cpx * s0;
                        s1 += 2 * b00 * _gx[32];
                        _gx[192] = s1;
                        s2 = cpx*s1 + 1 * b01 *s0;
                        s2 += 2 * b00 * _gx[160];
                        _gx[320] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 2 * b01 *s0;
                        s2 += 2 * b00 * _gx[288];
                        _gx[448] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 3 * b01 *s0;
                        s2 += 2 * b00 * _gx[416];
                        _gx[576] = s2;
                        s0 = _gx[96];
                        s1 = cpx * s0;
                        s1 += 3 * b00 * _gx[64];
                        _gx[224] = s1;
                        s2 = cpx*s1 + 1 * b01 *s0;
                        s2 += 3 * b00 * _gx[192];
                        _gx[352] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 2 * b01 *s0;
                        s2 += 3 * b00 * _gx[320];
                        _gx[480] = s2;
                        s0 = s1;
                        s1 = s2;
                        s2 = cpx*s1 + 3 * b01 *s0;
                        s2 += 3 * b00 * _gx[448];
                        _gx[608] = s2;
                        s1 = _gx[512];
                        s0 = _gx[384];
                        _gx[896] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[256];
                        _gx[768] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[128];
                        _gx[640] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[0];
                        _gx[512] = s1 - xlxk * s0;
                        s1 = _gx[544];
                        s0 = _gx[416];
                        _gx[928] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[288];
                        _gx[800] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[160];
                        _gx[672] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[32];
                        _gx[544] = s1 - xlxk * s0;
                        s1 = _gx[576];
                        s0 = _gx[448];
                        _gx[960] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[320];
                        _gx[832] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[192];
                        _gx[704] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[64];
                        _gx[576] = s1 - xlxk * s0;
                        s1 = _gx[608];
                        s0 = _gx[480];
                        _gx[992] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[352];
                        _gx[864] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[224];
                        _gx[736] = s1 - xlxk * s0;
                        s1 = s0;
                        s0 = _gx[96];
                        _gx[608] = s1 - xlxk * s0;
                    }
                    __syncthreads();
                    double xjxi = rjri[0];
                    double yjyi = rjri[1];
                    double zjzi = rjri[2];
                    double xlxk = rlrk[0];
                    double ylyk = rlrk[32];
                    double zlzk = rlrk[64];
                    switch (gout_id) {
                    case 0:
                        dd = dd_cache[0];
                        Ix = gx[832];
                        Iy = gx[1024];
                        Iz = gx[2048];
                        prod_xy = Ix * Iy * dd;
                        prod_xz = Ix * Iz * dd;
                        prod_yz = Iy * Iz * dd;
                        v_ix += (ai2 * gx[864] - 2 * gx[800]) * prod_yz;
                        v_kx += (ak2 * gx[960] - 2 * gx[704]) * prod_yz;
                        v_iy += ai2 * gx[1056] * prod_xz;
                        v_ky += ak2 * gx[1152] * prod_xz;
                        v_iz += ai2 * gx[2080] * prod_xy;
                        v_kz += ak2 * gx[2176] * prod_xy;
                        v_jx += aj2 * (gx[864] - xjxi * Ix) * prod_yz;
                        v_lx += (al2 * (gx[960] - xlxk * Ix) - 1 * gx[320]) * prod_yz;
                        v_jy += aj2 * (gx[1056] - yjyi * Iy) * prod_xz;
                        v_ly += al2 * (gx[1152] - ylyk * Iy) * prod_xz;
                        v_jz += aj2 * (gx[2080] - zjzi * Iz) * prod_xy;
                        v_lz += al2 * (gx[2176] - zlzk * Iz) * prod_xy;
                        dd = dd_cache[256];
                        Ix = gx[672];
                        Iy = gx[1152];
                        Iz = gx[2080];
                        prod_xy = Ix * Iy * dd;
                        prod_xz = Ix * Iz * dd;
                        prod_yz = Iy * Iz * dd;
                        v_ix += (ai2 * gx[704] - 1 * gx[640]) * prod_yz;
                        v_kx += (ak2 * gx[800] - 1 * gx[544]) * prod_yz;
                        v_iy += ai2 * gx[1184] * prod_xz;
                        v_ky += (ak2 * gx[1280] - 1 * gx[1024]) * prod_xz;
                        v_iz += (ai2 * gx[2112] - 1 * gx[2048]) * prod_xy;
                        v_kz += ak2 * gx[2208] * prod_xy;
                        v_jx += aj2 * (gx[704] - xjxi * Ix) * prod_yz;
                        v_lx += (al2 * (gx[800] - xlxk * Ix) - 1 * gx[160]) * prod_yz;
                        v_jy += aj2 * (gx[1184] - yjyi * Iy) * prod_xz;
                        v_ly += al2 * (gx[1280] - ylyk * Iy) * prod_xz;
                        v_jz += aj2 * (gx[2112] - zjzi * Iz) * prod_xy;
                        v_lz += al2 * (gx[2208] - zlzk * Iz) * prod_xy;
                        dd = dd_cache[512];
                        Ix = gx[640];
                        Iy = gx[1056];
                        Iz = gx[2208];
                        prod_xy = Ix * Iy * dd;
                        prod_xz = Ix * Iz * dd;
                        prod_yz = Iy * Iz * dd;
                        v_ix += ai2 * gx[672] * prod_yz;
                        v_kx += (ak2 * gx[768] - 1 * gx[512]) * prod_yz;
                        v_iy += (ai2 * gx[1088] - 1 * gx[1024]) * prod_xz;
                        v_ky += ak2 * gx[1184] * prod_xz;
                        v_iz += (ai2 * gx[2240] - 1 * gx[2176]) * prod_xy;
                        v_kz += (ak2 * gx[2336] - 1 * gx[2080]) * prod_xy;
                        v_jx += aj2 * (gx[672] - xjxi * Ix) * prod_yz;
                        v_lx += (al2 * (gx[768] - xlxk * Ix) - 1 * gx[128]) * prod_yz;
                        v_jy += aj2 * (gx[1088] - yjyi * Iy) * prod_xz;
                        v_ly += al2 * (gx[1184] - ylyk * Iy) * prod_xz;
                        v_jz += aj2 * (gx[2240] - zjzi * Iz) * prod_xy;
                        v_lz += al2 * (gx[2336] - zlzk * Iz) * prod_xy;
                        dd = dd_cache[768];
                        Ix = gx[576];
                        Iy = gx[1152];
                        Iz = gx[2176];
                        prod_xy = Ix * Iy * dd;
                        prod_xz = Ix * Iz * dd;
                        prod_yz = Iy * Iz * dd;
                        v_ix += (ai2 * gx[608] - 2 * gx[544]) * prod_yz;
                        v_kx += ak2 * gx[704] * prod_yz;
                        v_iy += ai2 * gx[1184] * prod_xz;
                        v_ky += (ak2 * gx[1280] - 1 * gx[1024]) * prod_xz;
