int rys_ejk_ip1_unrolled(RysIntEnvVars *envs, JKEnergy *jk, BoundsInfo *bounds,
                        int *pool, double *dd_pool)
{
    int li = bounds->li;
    int lj = bounds->lj;
    int lk = bounds->lk;
    int ll = bounds->ll;
    int ijkl = li*125 + lj*25 + lk*5 + ll;
    int nroots = bounds->nroots;
    int nsq_per_block = 256;
    int gout_stride = 1;

    switch (ijkl) {
    case 156:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 256:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 261:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 280:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 281:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 285:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    case 305:
        nsq_per_block = 32;
        gout_stride = 8;
        break;
    }

    cudaDeviceProp prop;
    cudaGetDeviceProperties(&prop, 0);
    int workers = prop.multiProcessorCount;
    int *head = pool + workers * QUEUE_DEPTH;
    cudaMemset(head, 0, sizeof(int));

